# -*- coding: utf-8 -*-
import execjs
import base64
import json

"""
企名片js破解
"""


def decrypt(encrypt_data):
    ctx = execjs.compile(open('qmp_js_parse.js').read())
    return base64.b64decode(ctx.call('get_decrypt', encrypt_data))


if __name__ == '__main__':
    encrypt_data =""
    decrypt_data = decrypt(encrypt_data)

    json_data = json.loads(decrypt_data)
    list_data = json_data['list']
    for data in list_data:
        print(data)